import axios from "axios";
import React, {useState} from "react";
import { Form, Button } from 'react-bootstrap';

function CrearAnuncio(){

    //state variable
    const [data, setData] = useState({
        id: "",
        titulo: "",
        descripcion: "",
        variante: "",
        parqueId: ""
    });
        // e.preventDefault();
        // try{
        //     const response = await axios.post('http://localhost:4000/api/parques/anuncio', {});
        //     console.log(response.data);
        // }catch(error){
        //     console.log(error.response);
        // }

    function handle(e){
        const newData={...data};
        newData[e.target.id] = e.target.value;
        setData(newData);
        console.log(newData);
    }
    return (
        <Form>
        <Form.Group className="mb-3">
            <Form.Label>Titulo</Form.Label>
            <Form.Control onChange={(e) => handle(e)} value={data.titulo} id="titulo" type="text" placeholder="Enter email" />
            <Form.Text className="text-muted">
            We'll never share your email with anyone else.
            </Form.Text>
        </Form.Group>

        <Form.Group className="mb-3">
            <Form.Label>Descripcion</Form.Label>
            <Form.Control onChange={(e) => handle(e)} value={data.descripcion} id="descripcion" type="text" placeholder="Password" />
        </Form.Group>
        <Button variant="primary" type="submit">
            Submit
        </Button>
        </Form>
    );
}


export default CrearAnuncio;
